import './output.css';

const Navbar = ({ user }) => {
  return (
    <header
      className="fixed top-0 left-0 right-0  border-b-8 shadow-md z-500 h-24"
      style={{
        background: 'linear-gradient(to right,#FFE4E1 25%, #FFDAB9 60%,	#6B8E23)',
        borderColor: '#808000',
      }}
    >
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-4 flex justify-between items-center">
        <div
          className="text-5xl mb-4 text-center font-bold cursor-pointer transition-transform duration-700 ease-in-out transform hover:scale-105"
          style={{
            fontFamily: "'Irish Grover', system-ui",
            color: '#FF69B4',
            WebkitTextStroke: '0.2px #228B22',
            textShadow: `
            0 0 4px rgba(248, 204, 229, 0.8),
            0 0 10px rgba(248, 204, 229, 0.6),
            0 0 20px rgba(248, 204, 229, 0.4)`,
            transition: 'filter 0.7s ease-in-out, transform 0.7s ease-in-out',
          }}
          onMouseEnter={(e) => {
            e.currentTarget.style.filter = 'brightness(1.2) saturate(1.3)';
          }}
          onMouseLeave={(e) => {
            e.currentTarget.style.filter = 'brightness(1) saturate(1)';
          }}
        >
          SafeSpace
        </div>

        <nav className="hidden md:flex space-x-8 text-gray-700 text-sm font-medium items-center">
          <a
            href="/home"
            className="hover:text-pink-600 text-3xl"
            style={{ fontFamily: 'Tilt Neon', color: 'indigo' }}
          >
            Home
          </a>
          <a
            href="#features"
            className="hover:text-pink-600 text-3xl"
            style={{ fontFamily: 'Tilt Neon', color: 'indigo' }}
          >
            Features
          </a>
          <a
            href="#how-it-works"
            className="hover:text-pink-600 text-3xl"
            style={{ fontFamily: 'Tilt Neon', color: 'indigo' }}
          >
            How it Works
          </a>
          <a
            href="#contact"
            className="hover:text-pink-600 text-3xl"
            style={{ fontFamily: 'Tilt Neon', color: 'indigo' }}
          >
            Contact
          </a>
        </nav>

        <div className="space-x-4">
          {user ? (
            user.pfp ? (
              <img
                src={user.pfp}
                alt="Profile"
                className="w-12 h-12 rounded-full border-2 border-pink-400 shadow"
              />
            ) : (
              <div className="w-12 h-12 rounded-full bg-pink-300 flex items-center justify-center text-white text-2xl shadow">
                ðŸ’–
              </div>
            )
          ) : (
            <button
              onClick={() => {
                window.location.href = '/login';
              }}
              className="hidden md:inline-block px-6 py-2 text-3xl font-semibold bg-pink-300 text-pink-900 rounded-full shadow-md border border-pink-400 hover:bg-pink-400 hover:text-pink-950 hover:shadow-lg transition-all duration-300 ease-in-out"
              style={{ fontFamily: 'Tilt Neon' }}
            >
              Login
            </button>
          )}
        </div>
      </div>
    </header>
  );
};

export default Navbar;
